import { enums, types } from '../index'
import { newCustomer, CID, ADGROUP_ID } from '../test_utils'
const customer = newCustomer()

describe('Text Ads', () => {
    let adgroup_ad_rn = ''
    let ad_rn = ''

    const ad: types.AdGroupAd = {
        ad_group: `customers/${CID}/adGroups/${ADGROUP_ID}`,
        status: enums.AdGroupAdStatus.PAUSED,
        ad: {
            final_urls: ['http://www.example.com'],
            expanded_text_ad: {
                headline_part1: 'adfasdf',
                headline_part2: 'erertert',
                headline_part3: 'toutytyiyu',
                description: 'asdfasdfasdfadsf asdf asd',
                description2: 'asdfasdfasdf',
                path1: 'pathq',
                path2: 'pathr',
            },
        },
    }

    it('can create an expanded text ad', async () => {
        const { results } = await customer.adGroupAds.create(ad, { validate_only: false })
        expect(results instanceof Array).toEqual(true)

        adgroup_ad_rn = results[0]

        const ad_id = adgroup_ad_rn.split('/')[3].split('~')[1]
        const customer_id = adgroup_ad_rn.split('/')[1]

        ad_rn = `customers/${customer_id}/ads/${ad_id}`

        // Give adwords servers a moment to breathe to avoid concurrent_modification error
        await new Promise(resolve => {
            setTimeout(() => {
                resolve()
            }, 3000)
        })
    })

    it('can edit the ad using the adService (no metrics reset)', async () => {
        const { results } = await customer.ads.update({
            resource_name: ad_rn,
            expanded_text_ad: {
                headline_part1: 'hello',
            },
        })

        expect(typeof results[0] === 'string').toEqual(true)
    })

    it('can get the ad via the adService', async () => {
        const returned_ad = await customer.ads.get(ad_rn)

        expect(returned_ad).toEqual(
            expect.objectContaining({
                final_urls: ['http://www.example.com'],
                expanded_text_ad: expect.objectContaining({
                    headline_part1: 'hello', // This part should have been modified
                    headline_part2: 'erertert', // This part should be the same
                }),
            })
        )
    })

    it('can delete the ad', async () => {
        await customer.adGroupAds.delete(adgroup_ad_rn)

        const deleted_ad = await customer.adGroupAds.get(adgroup_ad_rn)
        expect(deleted_ad.status).toBe(enums.AdGroupAdStatus.REMOVED)
    })
})

describe('Image Ads', () => {
    it('can upload an image ad', async () => {
        const ad = {
            ad_group: `customers/${CID}/adGroups/${ADGROUP_ID}`,
            status: enums.AdGroupAdStatus.PAUSED,
            ad: {
                final_urls: ['http://www.example.com'],
                type: enums.AdType.IMAGE_AD,
                name: 'ad #1',
                display_url: 'https://example.com',
                image_ad: {
                    image_url: 'https://image.com/image.png',
                    pixel_width: 300,
                    pixel_height: 250,
                    mime_type: enums.MimeType.IMAGE_PNG,
                    data: B64,
                },
            },
        }

        const { results } = await customer.adGroupAds.create(ad, { validate_only: true })
        expect(results instanceof Array).toEqual(true)
    })
})

describe('Reporting fields', () => {
    it('can get policy summary field', async () => {
        const results = await customer.report({
            entity: 'ad_group_ad',
            attributes: ['ad_group_ad.status', 'ad_group_ad.policy_summary'],
            limit: 1,
        })

        expect(results instanceof Array).toEqual(true)
        expect(typeof results[0].ad_group_ad.status).toEqual('number')
        expect(typeof results[0].ad_group_ad.policy_summary.review_status).toEqual('number')
    })
})

